import React from "react";

export default function Photos(props) {
  console.log(props);
  if (props.photos) {
    return (
      <div className="Photos">
        {props.photos.map(function (photos, index) {
          return <img src={photos.src.landscape} />;
        })}
      </div>
    );
  } else {
    return null;
  }
}
